import React from "react";
import "./VideoList.css"

const VideoList = (props) => {
    if (props.Response.data){
    const imgs = props.Response.data.items
    console.log(imgs)
    const img = imgs.map((item) => {
        return( 
                <div className="row list-cards col-12" key={item.id.videoId}>
                    <div className="col-7">
                    <img className="nail-imgs col-10 offset-1 mt-3" src={item.snippet.thumbnails.high.url}/>
                    </div>
                    <div className="container col-5 d-flex align-items-center">
                        <h1 className="h5 text-center">{item.snippet.title}</h1>
                    </div>
                    <hr className="mt-2 col-8 offset-2" />
                </div>
            )
    })

    return (
        <div> {img} </div>
    )
}
}

export default VideoList;
